void NativeXmtpv3::registerModule(
    jsi::Runtime &rt, std::shared_ptr<react::CallInvoker> callInvoker) {
  auto invoker =
      std::make_shared<uniffi_runtime::UniffiCallInvoker>(callInvoker);
  auto tm = std::make_shared<NativeXmtpv3>(rt, invoker);
  auto obj = rt.global().createFromHostObject(rt, tm);
  rt.global().setProperty(rt, "NativeXmtpv3", obj);
}

void NativeXmtpv3::unregisterModule(jsi::Runtime &rt) {
  uniffi::xmtpv3::registry::clearRegistry();
}

jsi::Value NativeXmtpv3::get(jsi::Runtime &rt, const jsi::PropNameID &name) {
  try {
    return jsi::Value(rt, props.at(name.utf8(rt)));
  } catch (std::out_of_range &e) {
    return jsi::Value::undefined();
  }
}

std::vector<jsi::PropNameID> NativeXmtpv3::getPropertyNames(jsi::Runtime &rt) {
  std::vector<jsi::PropNameID> rval;
  for (auto &[key, value] : props) {
    rval.push_back(jsi::PropNameID::forUtf8(rt, key));
  }
  return rval;
}

void NativeXmtpv3::set(jsi::Runtime &rt, const jsi::PropNameID &name,
                       const jsi::Value &value) {
  props.insert_or_assign(name.utf8(rt), &value);
}

